import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
        <div>
            <header>
                <img src='https://www.freelogodesign.org/Content/img/logo-samples/flooop.png'/>
            </header>
            <nav>
                <div>
                    Profile
                </div>
                <div>
                    Messages
                </div>
            </nav>
            <div>
                Main content
            </div>
        </div>
    );
}

export default App;
